import React from "react";

import { Link } from "react-router-dom";

function Navigation() {
  return (
    <div>
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="/AboutMe">ABOUT ME</Link>
        </li>
        <li>
          <Link to="/AboutMe">WORK</Link>
        </li>
        <li>
          <Link to="/AboutMe">CONTACT</Link>
        </li>
      </ul>
    </div>
  );
}

export default Navigation;
